import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Navigate from "./Navigate";
import Billboard from "./Billboard";

export class Home extends Component {

  constructor(props){
    super(props);
    this.state = {
      songList:[],
      error:"no",
      email:null
    };
  }
  
  componentDidMount() {
    /*
    fetch('http://localhost:5050/billboard100', { 
            method: 'POST', 
            headers: { 
              "Access-Control-Allow-Origin": "*",
              "Access-Control-Allow-Methods": "POST",
              "Access-Control-Allow-Headers": "Authorization",
              "Content-Type": "application/json" 
            }
        }) 
        .then(
          (response)=>{ return response.json() }
        )
        .catch(error=>{this.setState({error:error})})
        .then(data=>this.setState({songList:data}))
        .then(()=>this.state.songList.forEach(e => {
          console.log(e)
        }))
        //<Billboard songs={this.state.songList}/>
        */
       console.log("1 "+this.state.email);
       console.log(this.props.location.state.email);
       this.setState({email:this.props.location.state.email},console.log("2 "+this.state.email));
       //console.log("2 "+this.state.email);
  }
  

  render() {
    return (
        <Container fluid>
        <Navigate/>
        <Container fluid="lg">
          <Container fluid="lg">
            {this.state.error}
          </Container>
        </Container>
        </Container>
      );
  }

}

export default withRouter(Home);
